	add("tarantella", "{\"term\":\"tarantella\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027tarantella\u0027 a diminutive of {{w|Taranto}}, a town in southern Italy (but popularly associated with tarantola ‘tarantula’, on the belief that the dance was variously a result of, or cure for, its bite).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rapid dance in 6/8 time, originating in Italy, or a piece of music for such a dance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1868\u0027\u0027 — , \u0027s:Little Little Women\u0027 ch. 3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The set in which they found themselves was composed of English, and Amy was compelled to walk decorously through a cotillion, feeling all the while as if she could dance the \u0027\u0027tarantella\u0027\u0027 with relish\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1895\u0027\u0027 — , \u0027s:The Devotion of The Devotion of Enriquez\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;A \u0027\u0027tarantella\u0027\u0027, I presume?\u0026quot; blandly suggested the doctor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Miss Mannersley stopped, and rose carelessly from the piano. \u0026quot;It is a Moorish gypsy song of the fifteenth century,\u0026quot; she said dryly\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027 — , \u0027s: Public Opinion Public Opinion \u0027 ch\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"We learn to understand why our addled minds seize so little with precision, why they are caught up and tossed about in a kind of \u0027\u0027tarantella\u0027\u0027 by headlines and catch-words, why so often they cannot tell things apart or discern identity in apparent differences\", \"priority\":8}]}, \"synonyms\":{}}");

	add("tarbagan", "{\"term\":\"tarbagan\", \"etymology\":{\"influencers\":[], \"languages\":[\"southern altai\", \"English\", \"Russian\"], \"text\":\"Russian \u0027тарбаган\u0027 from Southern altai (Teleut).\u0026lt;ref\u0026gt;[http://www.merriam-webster.com/dictionary/tarbagan \u0026quot;tarbagan.\u0026quot;] \u0027Webster\u0027s Third New International Dictionary, Unabridged.\u0027 Merriam-Webster. 2002.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A species of marmot, which lives on the steppes of Central Asia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Philip Ziegler, \u0027The Black Death\u0027, Folio Society 2007, p. 13\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One can only guess which rodent was most readily to be found near Lake Issyk-Koul in 1338 but the experience of later epidemics points to the \u0027\u0027tarbagan\u0027\u0027 or Manchurian marmot, a beguiling squirrel-like creature much hunted for its skin\", \"priority\":3}]}, \"synonyms\":{}}");

	add("tarboosh", "{\"term\":\"tarboosh\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\"], \"text\":\"From Arabic \u0027طَرْبُوش\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A red felt or cloth cap with a tassel, worn in the Arab world; a fez\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, w:W. Somerset W.S. Maugham, \u0026quot;s:Of Human Bondage/Chapter Of Human Bondage\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He rehearsed all the afternoon how he should play the heavy father for the young man\u0027s edification till he reduced his children to helpless giggling. Just before he was due Athelny routed out an Egyptian \u0027\u0027tarboosh\u0027\u0027 and insisted on putting it on\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Constance\u0027, Faber \u0026amp; Faber 2004 (\u0027Avignon Quintet\u0027), p. 743\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They were for their part astonished, for nobody had told them to expect a pretty woman to dinner, and the Prince suggested an intriguing exoticism with his \u0027\u0027tarboosh\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0027Against the Day\u0027, Vintage 2007, p. 1215\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The man in the \u0027\u0027tarboosh\u0027\u0027 turned finally and nodded in a strangely familiar way\", \"priority\":7}]}, \"synonyms\":{}}");

