	add("tarnish", "{\"term\":\"tarnish\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027ternir\u0027 stem of \u0027ternir\u0027 (to make dull, deaden, tarnish) from Old french (842-ca. 1400) \u0027ternir\u0027 (to make dim, make wan) from Frankish {{m|frk|*tarnjan||to cover up, conceal, hide}}, from Proto-germanic {{m|gem-pro|*darnijaną||to conceal}}, from Proto-indo-european {{m|ine-pro|*dher(ǝ)-}}, {{m|ine-pro|*dhrē-||to hold, hold tight, support}}. Cognate with Old high german (ca. 750-1050) {{m|goh|*tarnjan}}, \u0027tarnen\u0027 (to hide, cover up, conceal) (Modern German \u0027tarnen\u0027 , Old english (ca. 450-1100) \u0027dyrnan\u0027 \u0027diernan\u0027 (to keep secret, conceal, hide, restrain, repress) More at {{l|en|dern}}, {{l|en|darn}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Oxidation or discoloration, especially of a decorative metal exposed to air\", \"priority\":1}]}, \"synonyms\":{}}");

