	add("tarsia", "{\"term\":\"tarsia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian from \u0027intarsiare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Intarsia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, Mary Philadelphia Merrifield, \u0027Original Treatises: Dating from the XIIth to XVIIIth Centuries on the Arts of Painting, in Oil, Miniature, Mosaic, and on Glass\u0027, republished 1999 [1967], \u0027Medieval and Renaissance Treatises on the Arts of Painting: Original Texts with English Translations\u0027, [http://books.google.com.au/books?id\u003dC-uiAK74XpsC\u0026amp;pg\u003dPR58\u0026amp;dq\u003d%22tarsia%22%7C%22tarsias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dqc8pUozsJcXikAX0tIDYBQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22tarsia%22%7C%22tarsias%22\u0026amp;f\u003dfalse page lviii\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Tarsia\u0027\u0027 work was frequently employed in decorating the choirs of churches, as well as the backs of the seats and the wainscotings. It was also used in the panels of doors\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Paul Barolsky, \u0027Michelangelo\u0027s Nose: A Myth and Its Maker\u0027, [http://books.google.com.au/books?id\u003dKwM03ken-S4C\u0026amp;pg\u003dPA96\u0026amp;dq\u003d%22tarsia%22%7C%22tarsias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d7NIpUvLhDsjLkwWqmIHADQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22tarsia%22%7C%22tarsias%22\u0026amp;f\u003dfalse page 96\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Andrea del Castagno portrays him, Vasari tells us, among the famous men and women painted in the Casa de\u0027 Carducci, and Benedetto da Maiano, he also notes, portrays Dante on a \u0027\u0027tarsia\u0027\u0027 door in the Palazzo della Signoria\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, w:Giorgio Giorgio Vasari, Julia Conaway Bondanella, Peter Bondanella (translators), \u0027The Lives of the Artists\u0027, [http://books.google.com.au/books?id\u003d43yEDKzADr0C\u0026amp;pg\u003dPA113\u0026amp;dq\u003d%22tarsia%22%7C%22tarsias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d6c8pUoGGOYa_kgWaj4GwDQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22tarsia%22%7C%22tarsias%22\u0026amp;f\u003dfalse page 113\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"It only remained for him to teach his method to those who worked in \u0027\u0027tarsia\u0027\u0027, which is the craft of inlaying coloured pieces of wood, and he stimulated these artisans so much that they developed excellent procedures and useful techniques from his teaching, for both then and afterwards many excellent works brought fame and profit to Florence for many years\", \"priority\":10}]}, \"synonyms\":{}}");

	add("tarsier", "{\"term\":\"tarsier\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\", \"ancient greek (to 1453)\", \"Latin\", \"multiple languages\"], \"text\":\"from French \u0027tarsier\u0027 from Latin \u0027tarsus\u0027 () from Ancient greek (to 1453) \u0027ταρσός\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|Philippine Tarsier \u0027Tarsius syrichta\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An insectivorous primate of the \u0027Tarsiidae\u0027 family, having very large eyes and long feet, native mainly to several islands of Southeast Asia\", \"priority\":2}]}, \"synonyms\":{}}");

	add("tartlet", "{\"term\":\"tartlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|tart|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small tart (pastry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A girl or young woman considered promiscuous\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Stephen Coonts, \u0027The Cannibal Queen: A Flight Into the Heart of America\u0027, Open Road Integrated Media (2010), ISBN 9781453205570, [http://books.google.com/books?id\u003d6eUxtU-GQu0C\u0026amp;pg\u003dPT51 unnumbered page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The only excitement I had was watching a \u0027\u0027tartlet\u0027\u0027 in a teeny-weeny bikini that barely contained her truly mammoth assets light a cigarette and suck on it with puckered, painted, Lolita lips\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Jo Beverley, \u0027Emily and the Dark Angel\u0027, Signet Eclipse (2010), ISBN 9780451231253, [http://books.google.com/books?id\u003dxd3X5x_-MOoC\u0026amp;pg\u003dPT103 unnumbered page\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;She\u0027s a whore. A \u0027\u0027tartlet\u0027\u0027. Junia, he \u0027bought\u0027 her for a hundred and fifty guineas, and then had the nerve to ask me to marry him!\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Pastor Shirley, \u0027S.E.C.R.E.T.S. of the First Ladies\u0027, Dog Ear Publishing (2010), ISBN 9781608442256, [http://books.google.com/books?id\u003dLF2zUsUiv9YC\u0026amp;pg\u003dPA77 page 77\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"She hated that a large chunk of Jerry\u0027s income supported his little \u0027\u0027tartlets\u0027\u0027 instead of being directed into their household as it should have been\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, A. K. Wrox, \u0027Arrabella Candellarbra \u0026amp; The Questy Thing to End All Questy Things\u0027, Clan Destine Press (2011), ISBN 9780980790061, [http://books.google.com/books?id\u003dB7yDCZkyELYC\u0026amp;pg\u003dPT136 unnumbered page\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Be gone \u0027\u0027tartlets\u0027\u0027! Your feminine charms hold no power over me,\u0027 he said\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Sarah Nicole Prickett, \u0026quot;[http://www.theglobeandmail.com/arts/celebrity-news/kristen-stewart-should-not-have-apologized-and-heres-why/article4445416/ Kristen Stewart should not have apologized, and here\u0027s why]\u0026quot;, \u0027The Globe and Mail\u0027, 29 July 2012\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"I have yet to see a Hollywood \u0027\u0027tartlet\u0027\u0027 apologize for weighing 95 pounds, or for playing dumb to stay popular, or for always being the sidekick when there\u0027s action\", \"priority\":12}]}, \"synonyms\":{}}");

